import React from "react";

import * as Comp from "./body/index";

const Body = () => {
  return (
    <template>
      <Comp.Banner />
      <Comp.Content />
      <Comp.Register />
      <Comp.Program />
      <Comp.Session />
      <Comp.Faqs />
    </template>
  );
};

export default Body;
